Meet Guillaume Durand—a retired R22eR Sergeant who has faced some of life’s toughest battles. Deployed to Afghanistan and Latvia, his military career was filled with honour, leadership, and camaraderie. But life after service brought new challenges—PTSD, chronic pain, and a loss of purpose that led to struggles with mental health and even being unhoused 💛

Watch his journey as he reclaims his strength, finds healing through sport, and inspires others along the way 🤝

Check out Guillaume’s full version coming later today!

